import React from 'react'
import HeaderStudent from "../../HeaderStudent";
import GuideNav from "../../GuideNav";
import WebsiteFooter from "../../../general/WebsiteFooter";
import "../../PageContents.css";
import "./AddSupervisor.css";


const handleChange = e => {
 
};


const AddSupervisor = () => {
  return (
    <div>
      <HeaderStudent />
      <div className="main-div">
        <div>
          <div className="form-box">
            <input 
            type="search" 
            className="search-for-Supervisor"
            onChange = {handleChange}
            />
            <div className="Supervisor-Card">
              <button className="button-Add-Supervisor"> التقديم لطلب الاشراف </button>
              <p className="p-Supervisor-Card">
                aaaaaaaaaaaaaaaaaa {}  : اسم المشرف
                <br />
                aaaaaaaaaaaaaaaaaa {}  : اسم المشرف


              </p>
            </div>
            
          
          </div>
        </div>
        <GuideNav />
      </div>
      <WebsiteFooter />
    </div>

  )
}

export default AddSupervisor
